import React , {useEffect, useState} from 'react';
import {ManagerNavBar} from "./ManagerNavBar";


export const Manager = ()=> {

    const logout = ()=> {
        Axios.get('http://localhost:3005/logout').then( (response)=> {
          setloginStatus('');
        });
    }

    return (
        <div>
            <h1>Manager</h1>
            <button>logout</button>
            {<ManagerNavBar/>}
            <hr></hr>
            <h2>Manager Home specific</h2>
        </div>
    );
}
